    $height: 400,
    title: {
        left: 30,
        top: 30,
        text: ''ECharts 入门示例''
    },
    tooltip: {},
    legend: {
        top: 30,
        data: [''销量'']
    },
    grid: {
        top: 90,
        bottom: 50
    },
    xAxis: {
        data: [''衬衫'', ''羊毛衫'', ''雪纺衫'', ''裤子'', ''高跟鞋'', ''袜子'']
    },
    yAxis: {},
    series: [
        {
            name: ''销量'',
            type: ''bar'',
            data: [5, 20, 36, 10, 10, 20]
        }
    ]
}
